import React from 'react';
import { useStyles } from './Header.styles';

interface Props {
  rates?: string[]
}

export const Header:React.FC<Props> = ({ rates }) => {
  const styles = useStyles();
  console.log('rates - ', rates);
  return (
    <header className={styles.header}>
      <div className={styles.logoWrapper}>Currency Convector</div>
      {rates && (
        <div className={styles.ratesWrapper}>
          <div className={styles.rateWrapper}>
            <p>EUR</p>
            <p className={styles.rateValue} title='Selling'>39.50</p>
            <p className={styles.rateValue} title='Buying'>40.45</p>
          </div>
          <div className={styles.rateWrapper}>
            <p>USD</p>
            <p className={styles.rateValue} title='Selling'>41.50</p>
            <p className={styles.rateValue} title='Buying'>41.99</p>
          </div>
        </div>
      )}
    </header>
  );
};
